import React from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import { loginActions } from '../store/storeLogin';



function Home() {
    //Almacenamos en la variable userData el estado del store
    // Selector LEE LO QUE TIENE GUARDADO EL LOGIN 
    const userData = useSelector(state => state.login) // ACCEDIENDO A "STORELOGIN" PARA VER SI EL USUARIO ESTA AUTENTICAD O NO
    const navigate = useNavigate()
    const dispatch = useDispatch();


    const isLoggedin = userData.isAutenticated

    useEffect(() => {  // comprobar en home si el usuario esta autenticado
        if (!isLoggedin) {
            navigate('/')
        }
    }, [isLoggedin, navigate])

    // log out
    const handleLogout = () => {
        dispatch(loginActions.logout());
        // va a la pag raiz
        navigate('/');
    }
    // Comprobamos por consola qué obtenemos en userData
    console.log(userData)

    return (
        <ThemeProvider theme={theme}>
            <Grid
                container
                justifyContent="center"
                alignItems="center"
                style={{
                    height: '100vh',
                    backgroundImage: "url(https://images.unsplash.com/photo-1559999831-7deaf136d4a9?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D)",
                    backgroundSize: 'cover', // Ajusta el tamaño de la imagen de fondo
                }}
            >
                <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square style={{ backgroundColor: 'black', backgroundSize: 'cover' }}></Grid>
                <div>
                    <h1>Home de Borja Vega</h1>
                    <h2>Nombre de usuario: {userData.userName}</h2>
                    <h2>Rol: {userData.userRol}</h2>
                    <button onClick={handleLogout}>Salir</button>
                </div>
            </Grid>
        </ThemeProvider>

    );
}
export default Home


